(12, 28, '0', 1399475834, '', 1, 1, 0, 144, 0, '停车棚遮阳棚休闲雨棚救灾帐篷户外定做可拆卸棚简易棚汽车车棚', '', '', 'admin', '未知', '', 1399475834, 1399475884, 1, '车棚,遮阳,休闲,雨棚,救灾,帐篷,户外,定做,可拆卸,简易', 0, 0, 0, 0, 0, 0, '停车棚遮阳棚休闲雨棚救灾帐篷户外定做可拆卸棚简易棚汽车车棚 、 114个帐篷岗亭今全上岗', '', 1, 0, 0, 11),
(13, 28, '0', 1399475888, '', 1, 1, 0, 89, 0, '50个“帐篷”岗亭已于7月15日安装完成', '', '', 'admin', '未知', '', 1399475888, 1399475895, 1, '50个,帐篷,岗亭,已于,7月,15日,安装,完成,本报讯,', 0, 0, 0, 0, 0, 0, '本报讯（通讯员扬公宣记者高敏实习生李清）记者昨从市公安局了解到，50个帐篷岗亭已于7月15日安装完成，另外64个岗亭今将全部安装完成。这在全省系首次实行。昨日，警方公布了50个流动岗亭的具体方位。', '', 1, 0, 0, 12),
(14, 29, '0', 1399475901, '', 1, 1, 0, 161, 0, '流动岗亭是折叠式的，只需5分钟就能安装完毕', '', '', 'admin', '未知', '', 1399475901, 1399475912, 1, '流动,岗亭,折叠式,只需,5分钟,就能,安装,完毕,流动,岗', 0, 0, 0, 0, 0, 0, '流动岗亭是折叠式的，只需5分钟就能安装完毕；岗亭及里面所设置物品全是便携式的，大大提高了工作效率。每个岗亭派驻一名警察和一名保安，每个民警除配有七小件之外，岗点还将配备对讲机、阻车器等装备。岗亭帐篷四面都印有岗亭所在派出所的电话号码，方便市', '', 1, 0, 0, 13),
(15, 29, '0', 1399475916, '', 1, 1, 0, 66, 0, '帐篷岗亭专门设置在夜间，执勤时间为晚8时至第二天早上5时', '', '', 'admin', '未知', '', 1399475916, 1399475924, 1, '帐篷,岗亭,专门,置在,夜间,执勤,时间,时至,第二天,早上', 0, 0, 0, 0, 0, 0, '帐篷岗亭专门设置在夜间，执勤时间为晚8时至第二天早上5时。此外，岗亭是流动性的，警方将根据一段时间的发案特点，在案件高发地段、治安复杂区域及市区主要道路交叉口设置。此外，一些开放式小区也将增设。目前第一批设置的50个岗点多安装在主要道路的交叉', '', 1, 0, 0, 14),
(16, 29, '0', 1399475929, '', 1, 1, 0, 153, 0, '主干道文昌路上就设有9个帐篷岗亭', '', '', 'admin', '未知', '', 1399475929, 1399475938, 1, '主干道,文昌,路上,设有,9个,帐篷,岗亭,警方,公布,流动', 0, 0, 0, 0, 0, 0, '在警方公布的流动岗亭位置图上，记者看到，城区最集中的地段每个岗亭之间不超过200米，平均每个岔路口就设有一个。主干道文昌路上就设有9个帐篷岗亭，此外还有2个固定岗亭和2个查报站。扬子江路上则设有10个帐篷岗亭和3个固定岗亭以及2个查报站。就连偏僻的', '', 1, 0, 0, 15),
(17, 29, '0', 1399475943, '', 1, 1, 0, 194, 0, '扬州已有34个固定岗亭和10个查报站', '', '', 'admin', '未知', '', 1399475943, 1399475998, 1, '扬州,已有,34个,固定,岗亭,10个,查报,目前,扬州,已', 0, 0, 0, 0, 0, 0, '目前，扬州已有34个固定岗亭和10个查报站，加上新增的114个流动岗亭，在全市形成了一个严密的犯罪防控网。 （相关岗亭地点详见A13版） 天水：人行道上 搭建帐篷', '', 1, 0, 0, 16),
(18, 29, '0', 1399476006, '', 1, 1, 0, 156, 0, '一帐篷前几天坍塌至今无人管', '', '', 'admin', '未知', '', 1399476006, 1399476016, 1, '帐篷,前几天,坍塌,至今,无人,中国,甘肃,5月,6日讯,天', 0, 0, 0, 0, 0, 0, '中国甘肃网5月6日讯 据天天天水网消息 5月3日，家住秦州区藉河南路天水第一师范学校附近的张先生向生活热线反映，学校侧门处有一帐篷前几天坍塌至今无人管，经常有小孩跑到里面玩耍，还有些小学生在里面吸烟，帐篷上面是附近小区的电缆线，一旦起火，后果将', '', 1, 0, 0, 17),
(19, 29, '0', 1399476020, '', 1, 1, 0, 118, 0, '带着帐篷去旅游的中国人', '', '', 'admin', '未知', '', 1399476020, 1399476030, 1, '带着,帐篷,旅游,中国人,新华网,长沙,5月,6日电,记者,', 0, 0, 0, 0, 0, 0, '新华网长沙５月６日电（记者明星 张涛）随着旅游旺季的到来，景区的酒店价格贵、入住难等问题逐渐显现。为了轻松自在享受假期，带着帐篷去旅游正成为中国人户外活动的新时尚。 五一小长假期间，来自浙江、广东、广西以及湖南各地的上千名户外爱好者来到湖南林', '', 1, 0, 0, 18),
(20, 29, '0', 1399476034, '', 1, 1, 0, 111, 0, '我们这些玩帐篷的人都叫‘篷客', '', '', 'admin', '未知', '', 1399476034, 1399476042, 1, '我们,这些,帐篷,人都,篷客,一位,资深,驴友,表示,我们,', 0, 0, 0, 0, 0, 0, '一位资深驴友表示：我们这些玩帐篷的人都叫篷客，一般喜欢自己走线路，除非有好的创意，否则我们不愿意跟景区接触。 帐篷游的兴起，反映了参加者对于野外生活的向往，对于无拘无束状态的渴望。这些户外爱好者装备非常齐全，包括大桶饮用水、液化气罐、燃气灶', '', 1, 0, 0, 19),
(21, 29, '0', 1399476047, '', 1, 1, 0, 169, 0, '开发帐篷游产品时，相关景区需要加强配套的基础设施建设', '', '', 'admin', '未知', '', 1399476047, 1399476056, 1, '开发,帐篷,产品,相关,景区,需要,加强,配套,基础设施,建', 0, 0, 0, 0, 0, 0, '湖南怀化市旅游局民俗文化旅游研究专家蔡海军表示，开发帐篷游产品时，相关景区需要加强配套的基础设施建设，可以划定区域设立一些露营区。 蔡海军指出，帐篷游由于跟探险游、自驾游等连在一起，本身还是存在一定风险。游客在帐篷里过夜，要注意人身和财物安', '', 1, 0, 0, 20),
