(115, 29, '0', 1399714479, '', 1, 1, 0, 76, 0, '第80届世界汽车房车露营大会首度中国开营', '', '', 'admin', '未知', '', 1399714479, 1399714561, 1, '80届,世界,汽车,房车,露营,大会,首度,中国,开营,80', 0, 0, 0, 0, 0, 0, '第80届世界汽车房车露营大会首度中国开营 提到房车，国人大多还是感到陌生和新鲜，更多地是从欧美影视剧中看到他们的身影。近年来，随着中国自驾游的普及和流行，以及国内房车产业和先锋旅游人士的推广，这种在欧美早已大众化的旅行方式正在国内兴起并以加速', '', 1, 0, 0, 114),
(116, 29, '0', 1399714569, '', 1, 1, 0, 104, 0, '“带着房子出游”成时尚 厦门将建5个房车露营地', '', '', 'admin', '未知', '', 1399714569, 1399714577, 1, '带着,房子,出游,时尚,门将,5个,房车,营地,带上,家人,', 0, 0, 0, 0, 0, 0, '带上家人，开着房车，行驶于风景之间，车内有厨房可以煮咖啡自做美食，困了可以在车内大床上休息，完全不用担心宾馆涨价和景区餐馆爆满。这种带着房子旅游的方式离厦门人的生活越来越近。记者从厦门市房车露营协会了解到，厦企计划在两年内开发建设20个以上', '', 1, 0, 0, 115),
(117, 29, '0', 1399714592, '', 1, 1, 0, 143, 0, '深圳遮阳篷厂家什么牌子好', '', '', 'admin', '金宏发帐篷', '', 1399714592, 1399714635, 1, '深圳遮阳篷厂家', 0, 0, 0, 0, 0, 0, '最近有很多喜欢露营的朋友在论坛讨论户外帐篷什么牌子好？怎么能选择到质量好的户外帐篷？为此小编特意走访了几位有经验的专业驴友，整理出以下户外帐篷选购知识供大家做个参考，比如 深圳遮阳篷厂家 。 户外露营帐篷什么牌子好 户外帐篷什么牌子好这是很多', '', 1, 0, 0, 116),
(118, 29, '0', 1399714650, '', 1, 1, 0, 121, 0, '另类“房车”――自行车和帐篷的结合', '', '', 'admin', '未知', '', 1399714650, 1399714677, 1, '深圳订做岗亭棚厂家', 0, 0, 0, 0, 0, 0, '没有车，没有房，没有钻戒，但是你可以有一个人精彩的旅行。这个房车设计其实就是把帐篷安装到了自行车前轮上了啦。小编看望这个设计，感觉咱们也能DIY 一个，自备一辆自行车，一个帐篷，若干拆卸工具，把自行车前轮车条换成帐篷吧，喜欢的也可以把后轮改了', '', 1, 0, 0, 117),
(119, 29, '0', 1399714707, '', 1, 1, 0, 119, 0, '阳台是否有必要深圳定做彩蓬？', '', '', 'admin', '未知', '', 1399714707, 1399714749, 1, '深圳定做彩蓬', 0, 0, 0, 0, 0, 0, '阳台虽小，用处不少，霞光相映，风景犹好。现在的 深圳定做彩蓬 已不是从前存放物品的储物间了，特别是居室面积较小的业主，非常注意利用阳台这个空间。阳台的布置不仅要实用、宽敞、美观，同时还要注意安全。无遮阳篷之阳台，就达不到其实用、宽敞、美观，', '', 1, 0, 0, 118),
(120, 29, '0', 1399714751, '', 1, 1, 0, 160, 0, '遮阳篷就可以起到防晒，防灰尘', '', '', 'admin', '未知', '', 1399714751, 1399714766, 1, '遮阳,就可以,起到,防晒,灰尘,第一,风雨,来袭,或是,烈日', 0, 0, 0, 0, 0, 0, '第一， 风雨来袭或是烈日当空，遮阳篷就可以起到防晒，防灰尘，防雨雪的作用， 第二，如果楼上物品不慎坠落，遮阳篷可以起到保护作用。虽然可能性不大，但也偶有发生，所以不得不防。', '', 1, 0, 0, 119),
(121, 29, '0', 1399714774, '', 1, 1, 0, 160, 0, '深圳遮阳蓬厂家提醒大家', '', '', 'admin', '未知', '', 1399714774, 1399714814, 1, '深圳遮阳蓬厂家', 0, 0, 0, 0, 0, 0, '深圳遮阳蓬厂家提醒大家：想要做好防晒，享受生活的快乐', '', 1, 0, 0, 120),
(122, 29, '0', 1399714816, '', 1, 1, 0, 184, 0, '沈阳干线路口有望都设立遮阳篷', '', '', 'admin', '未知', '', 1399714816, 1399714837, 1, '沈阳,干线,路口,望都,设立,遮阳,4月,28日,网友,博大', 0, 0, 0, 0, 0, 0, '4月28日，网友@ 微博大草原发微博称：沈阳主要街路交叉口都有新变化，蓝色方形遮阳篷代替了不稳当的圆形遮阳伞，无论是交通协勤还是市民，都可以在等待过路口的时候纳凉避雨，缺点有点矮阻挡视线。', '', 1, 0, 0, 121),
(123, 29, '0', 1399714842, '', 1, 1, 0, 100, 0, '安装这样的遮阳篷是出于什么目的？', '', '', 'admin', '未知', '', 1399714842, 1399714852, 1, '安装,这样,遮阳,出于,什么,目的,安装,这样,遮阳,出于,', 0, 0, 0, 0, 0, 0, '安装这样的遮阳篷是出于什么目的？共安装了多少？就此事，沈阳晚报、沈阳网记者昨日采访了交管部门。 据介绍，沈阳目前共有7个路口安装了这种方形的遮阳篷，安装这种遮阳篷的目的就是用这7个主要路口进行示范，看看使用效果，如果效果好，我们将在全市主要路', '', 1, 0, 0, 122),
(124, 29, '0', 1399714868, '', 1, 1, 0, 156, 0, '这种遮阳篷遮阳的面积大，“这样可以方便市民遮挡阳光', '', '', 'admin', '未知', '', 1399714868, 1399714882, 1, '这种,遮阳,面积,这样,可以,方便,市民,遮挡,阳光,交管,', 0, 0, 0, 0, 0, 0, '交管部门表示，这种遮阳篷遮阳的面积大，这样可以方便市民遮挡阳光，在下雨天还可以在里面躲避风雨。另一方面，由于这种遮阳篷是安装在路口行人停止线以内的，在让市民躲避阳光雨雪的同时，也能保证行人和非机动车能够等在停止线以内，起到安全的作用。 针对', '', 1, 0, 0, 123),
(125, 29, '0', 1399714904, '', 1, 1, 0, 135, 0, '会说话的“遮阳篷”在南通市区路口上岗[组图]', '', '', 'admin', '未知', '', 1399714904, 1399714914, 1, '说话,遮阳篷,南通,市区,路口,上岗,组图,南通,网讯,记者', 0, 0, 0, 0, 0, 0, '南通网讯（记者 宋理沂）这个遮阳篷好啊，暴晒下雨的时候等红绿灯就不愁了!今天（7日）上午，在南通市区青年路跃龙路路口，不少过往的行人都被一旁正在安装的遮阳篷吸引，说出这样的评价。 南通市公安局交巡警二大队队长周鹏向记者介绍到，根据他们以往的分析', '', 1, 0, 0, 124),
(126, 24, '0', 1400043115, 'p', 1, 1, 0, 106, 0, '为深圳溪涌工人度假村设计安装的停车篷', '', '', 'admin', '金宏发帐篷', '/uploads/allimg/140514/1-1405141252250-L.jpg', 1400043115, 1400043217, 1, '深圳,溪涌,工人,度假村,设计,装的,车篷,深圳,溪冲,人工', 0, 0, 0, 0, 0, 0, '深圳溪冲人工度假村坐落在深圳市大鹏湾畔，这里青山环抱，绿水相拥，水洁沙细，海景迷人。村内绿树掩映，鸟语花香，十四栋别墅鳞次栉比。观海楼有供300人同时进餐的餐厅，还有大、中、小会议室及卡拉OK歌舞厅、KTV包房。村内有豪花客房、贵宾房、标准客房86', '', 1, 0, 0, 125),
(127, 24, '0', 1400043237, 'p', 1, 1, 0, 144, 0, '深圳溪涌工人度假村设计安装的停车篷', '', '', 'admin', '金宏发帐篷', '/uploads/allimg/140514/1-1405141254400-L.jpg', 1400043237, 1400043322, 1, '定做彩棚，定做雨棚，订做遮阳棚', 0, 0, 0, 0, 0, 0, '深圳溪涌工人度假村位于大鹏湾畔的溪涌湾，独享大鹏湾辽阔醉人海景', '', 1, 0, 0, 126),
(128, 24, '0', 1400043323, 'p', 1, 1, 0, 152, 0, '为深圳港龙城设计安装的展销篷', '', '', 'admin', '金宏发帐篷', '/uploads/allimg/140514/1-1405141256260-L.jpg', 1400043323, 1400043409, 1, '深圳定做帐篷，深圳帐篷厂家，深圳定做彩蓬，深圳雨棚厂家', 0, 0, 0, 0, 0, 0, ' 港隆城坐落于深圳市宝安区80区，西临广深公路107国道', '', 1, 0, 0, 127),
(129, 24, '0', 1400043424, 'p', 1, 1, 0, 105, 0, '为港龙城设计安装的展销篷03', '', '', 'admin', '未知', '/uploads/allimg/140514/1-140514125G40-L.jpg', 1400043424, 1400043455, 1, '龙城,设计,装的,展销,港隆,是由,鸿隆,控股,1383.h', 0, 0, 0, 0, 0, 0, '港隆城是由鸿隆控股(1383.hk)集团投资开发，。它是宝安目前唯一集百货、超市、餐饮、娱乐、文化、休闲等诸多功能于一体的大规模、综合性、现代化、高品质的标志性商业建筑群，总建筑面积达7.5万平方米，总投资逾10亿元。但全部商业面积只租不售。该模式给整', '', 1, 0, 0, 128),
(130, 24, '0', 1400043457, 'p', 1, 1, 0, 196, 0, '中粮幸福花园、岗亭双开篷', '', '', 'admin', '金宏发帐篷', '/uploads/allimg/140514/1-140514125P80-L.jpg', 1400043457, 1400043510, 1, '深圳定做帐篷，深圳帐篷厂家，深圳定做彩蓬，深圳雨棚厂家', 0, 0, 0, 0, 0, 0, '中粮幸福花园位于中粮幸福花园位于宝安区78区前进二路和流塘路交汇处', '', 1, 0, 0, 129),
(131, 24, '0', 1400043521, 'p', 1, 1, 0, 140, 0, '西乡老城区中粮幸福花园岗亭单开篷', '', '', 'admin', '未知', '/uploads/allimg/140514/1-140514125T50-L.jpg', 1400043521, 1400043576, 1, '西乡,老城区,中粮,幸福,花园,岗亭,单开篷,中粮,幸福,花', 0, 0, 0, 0, 0, 0, '中粮幸福花园所在的区域为西乡老城区。地处深圳宝安中心团组的中部核心位置。根据片区规划，西乡老城区将建设成为宝安中 心团组的三个主要的居住核心区之一，拥有完善的配套设施。而 本项目恰好位于宝安中心组团的西乡居住核心区，紧邻港隆城商 圈及天虹商圈', '', 1, 0, 0, 130),
(132, 24, '0', 1400043578, 'p', 1, 1, 0, 86, 0, '宝安 中粮幸福花园、岗亭篷【03】', '', '', 'admin', '未知', '/uploads/allimg/140514/1-1405141300020-L.jpg', 1400043578, 1400043633, 1, '宝安,中粮,幸福,花园,岗亭,配套,设施,编辑,学校,建安,', 0, 0, 0, 0, 0, 0, '配套设施 编辑 学校：建安小学、宝安中学 购物：天虹商', '', 1, 0, 0, 131),
(133, 24, '0', 1400043635, 'p', 1, 1, 0, 114, 0, '为欢乐海岸{豪丽斯}咖啡厅设计安装的固定篷', '', '', 'admin', '未知', '/uploads/allimg/140514/1-1405141301000-L.jpg', 1400043635, 1400043695, 1, '欢乐,海岸,豪丽,咖啡厅,设计,装的,固定,欢乐,海岸,地处', 0, 0, 0, 0, 0, 0, '欢乐海岸地处深圳湾商圈核心位置，位于深圳华侨城主题公园群与滨海大道之间，是深圳市塘郎山--华侨城--深圳湾城市功能轴的起点，是深圳市致力打造的高品质人文旅游、国际创意生活空间的中心。欢乐海岸汇聚全球大师智慧，以海洋文化为主题，以生态环保为理念', '', 1, 0, 0, 132),
(134, 24, '0', 1400043697, 'p', 1, 1, 0, 187, 0, '为欢乐海岸{豪丽斯}设计安装的固定篷【02】', '', '', 'admin', '未知', '/uploads/allimg/140514/1-1405141301550-L.jpg', 1400043697, 1400043741, 1, '欢乐,海岸,豪丽,设计,装的,固定,开创,性地,主题,商业,', 0, 0, 0, 0, 0, 0, '开创性地将主题商业与滨海旅游、休闲娱乐和文化创意融为一体，整合零售、餐饮、娱乐、办公、公寓、酒店、湿地公园等多元业态，形成独一无二的商业+娱乐+文化+旅游+生态的全新商业模式，真正实现集主题商业、时尚娱乐、健康生活三位一体的价值组合，以实际行', '', 1, 0, 0, 133),
(135, 24, '0', 1400043742, 'p', 1, 1, 0, 88, 0, '深圳蛇口西班牙餐厅电动棚【01】', '', '', 'admin', '未知', '/uploads/allimg/140514/1-1405141303000-L.jpg', 1400043742, 1400043802, 1, '深圳,蛇口,西班牙,餐厅,电动,深圳,蛇口,海上,世界,塔斯', 0, 0, 0, 0, 0, 0, '深圳蛇口海上世界塔斯卡西班牙风味餐厅*品味别样的异国风情让您回味无穷. 从门口进来就可以看到外面有一个露天小院，绿树成荫的小院与海上世界成邻。晚上在这里品酒自是悠然自得。西班牙人喜欢自由自在的生活，因此西班牙到处都是露天的餐饮场地，坐在露天小', '', 1, 0, 0, 134),
(136, 24, '0', 1400043804, 'p', 1, 1, 0, 183, 0, '深圳蛇口海上世界{西班牙}电动篷【02】', '', '', 'admin', '金宏发帐篷', '/uploads/allimg/140514/1-1405141303560-L.jpg', 1400043804, 1400043849, 1, '深圳,蛇口,海上,世界,西班牙,电动,蛇口,这边,外国人,好', 0, 0, 0, 0, 0, 0, '蛇口这边的外国人好多，上个星期过来海上世界玩，跟GF来这家餐厅试试鲜，毕竟没吃过西班牙的东西！！餐厅装修得很有味道，黄色外墙，红色沙发...听店家说，火腿是西班牙比较特色的食物，点了几样，觉得火腿是比平时吃的好吃一点，味道说不上来！！不过吃了几', '', 1, 0, 0, 135),
(137, 24, '0', 1400043851, 'p', 1, 1, 0, 165, 0, '蛇口{日本}七海饮食、手摇篷002', '', '', 'admin', '未知', '/uploads/allimg/140514/1-1405141304410-L.jpg', 1400043851, 1400043923, 1, '蛇口,日本,七海,饮食,手摇,002,蛇口,美食街,中国,美', 0, 0, 0, 0, 0, 0, '蛇口美食街，有中国美食，更有来自美、意、日、韩、泰、', '', 1, 0, 0, 136);
