(138, 24, '0', 1400043934, 'p', 1, 1, 0, 125, 0, '深圳蛇口{湾厦}幼儿园、法式篷【01】', '', '', 'admin', '金宏发帐篷', '/uploads/allimg/140514/1-1405141306040-L.jpg', 1400043934, 1400043980, 1, '深圳,蛇口,湾厦,幼儿园,法式,湾厦海,境界,位于,深圳市,', 0, 0, 0, 0, 0, 0, '湾厦海境界位于深圳市南山区蛇口后海大道东侧，地处后海湾核心居住区、紧邻后海大道的33万平米湾区地标综合体，全单一产权户型，占地面积44516.32平方米，', '', 1, 0, 0, 137),
(139, 24, '0', 1400043982, 'p', 1, 1, 0, 200, 0, '深圳蛇口{湾厦}幼儿园、法式篷【02】', '', '', 'admin', '未知', '/uploads/allimg/140514/1-140514130H90-L.jpg', 1400043982, 1400044063, 1, '深圳,蛇口,湾厦,幼儿园,法式,湾厦,幼儿园,实业,股份公司', 0, 0, 0, 0, 0, 0, '湾厦幼儿园是湾厦实业股份公司的下属单位，是深圳市潜能开发的实验园，以幼儿逻辑思维课程及心理健康课程为特色。', '', 1, 0, 0, 138),
(140, 29, '0', 1400434680, '', 1, 1, 0, 194, 0, '总结户外帐篷的款式及搭建方法', '', '', 'admin', '金宏发帐篷', '', 1400434680, 1400434745, 1, '总结,户外,帐篷,款式,搭建,方法,总结,户外,帐篷,款式,', 0, 0, 0, 0, 0, 0, '总结 户外帐篷 的款式及搭建方法 随着社会不断创新发展，越来越多的人喜欢个性化，喜欢自己拥有一种独特的风格。爱好户外运动的人对帐篷的款式就有一定的要求，因此，帐篷款式的设计关键是要看用户的体验。', '', 1, 0, 0, 139),
(141, 28, '0', 1402153530, 'p', 1, 1, -2, 96, 0, '深圳定做遮阳篷它采用双杆交叉支撑', '', '', 'admin', '未知', '', 1402153530, 1400434852, 1, '深圳帐篷厂家', 0, 0, 0, 0, 0, 0, '第一种，深圳帐篷厂家是屋脊形帐篷，它形状看起来像一间独立的小瓦房，', '', 1, 0, 0, 140),
(142, 29, '0', 1400434858, '', 1, 1, 0, 172, 0, '深圳定做雨棚是三角形帐篷', '', '', 'admin', '未知', '', 1400434858, 1400434887, 1, '深圳定做雨棚', 0, 0, 0, 0, 0, 0, '四种，深圳定做雨棚是三角形帐篷，它主要是前后采用人字形铁管作支架', '', 1, 0, 0, 141),
(143, 29, '0', 1400434895, '', 1, 1, 0, 175, 0, '深圳定做遮阳篷常见帐篷是十字穿法。', '', '', 'admin', '未知', '', 1400434895, 1400434930, 1, '深圳定做彩蓬', 0, 0, 0, 0, 0, 0, '深圳定做彩蓬一般的普通帐篷主要是把帐篷的内帐平铺在地上', '', 1, 0, 0, 142),
(144, 29, '0', 1401935588, '', 1, 1, 0, 140, 0, '深圳帐篷厂家为了适应不同的温度环境', '', '', 'admin', '未知', '', 1401935588, 1401935633, 1, '深圳,帐篷,厂家,为了,适应,不同,温度,环境,深圳,帐篷,', 0, 0, 0, 0, 0, 0, '深圳帐篷厂家 为了适应不同的温度环境，帐蓬又区分为单层、双层、三层等不同的结构： 单层的优势是轻便、经济、体积', '', 1, 0, 0, 143),
(145, 29, '0', 1401935644, '', 1, 1, 0, 196, 0, '深圳定做彩蓬提示外帐不直接在内帐底连接', '', '', 'admin', '未知', '', 1401935644, 1401935679, 1, '深圳,定做,彩蓬,提示,外帐,直接,在内,帐底,连接,打湿,', 0, 0, 0, 0, 0, 0, '打湿睡袋， 深圳定做彩蓬 而加设内帐后，外帐不直接在内帐底连接，人体散发的热气会透过内帐，凝结在外帐上的水珠可以直流地面，从这个意义上讲，单层帐蓬主要适合于较暧的地区或季节，双层帐蓬适合于凉爽季节或寒区。三层帐篷的设计是在内帐的里加另一层棉', '', 1, 0, 0, 144),
