(149, 28, '0', 1401935890, '', 1, 1, 0, 108, 0, '帐蓬质量优劣的主要性能指标购买深圳帐篷厂家', '', '', 'admin', '未知', '', 1401935890, 1401935925, 1, '帐蓬,质量,优劣,主要,性能,指标,购买,深圳,帐篷,厂家,', 0, 0, 0, 0, 0, 0, '帐蓬质量优劣的主要性能指标一般以抗风、防雨、稳定性好为标准， 深圳帐篷厂家 高山型的帐篷还要求质量轻、体积', '', 1, 0, 0, 148),
