(156, 28, '0', 1402155538, '', 1, 1, 0, 123, 0, '深圳帐篷厂家支撑与固定 可保护帐篷底，还可达到最佳防水效果', '', '', 'admin', '金宏发帐篷', '', 1402155538, 1402155595, 1, '深圳帐篷厂家', 0, 0, 0, 0, 0, 0, '深圳帐篷厂家支撑与固定,帐篷铺开后应首先固定帐四角，使帐篷底在地面上铺平定牢，如有条件，帐篷底下可垫块地席', '', 1, 0, 0, 155),
