(1, 0, 0, 50, '关于我们', '{cmspath}/about', 1, 'index.html', 1, 1, -1, 1, 0, '{style}/index_article.htm', '{style}/list_article.htm', '{style}/article_article.htm', '{typedir}/{Y}{M}{D}{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '深圳遮阳蓬,深圳彩蓬,深圳定做帐篷,定做电动蓬,深圳遮阳蓬厂家', '深圳定做帐篷，深圳帐篷厂家，深圳定做彩蓬，深圳雨棚厂家', '关于我们', 0, '{cmspath}/about', '', 0, 0, '', '<span style="font-size:14px;">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; <span style="font-size:14px;"><font style="FONT-SIZE: 10.5pt">深圳市金宏发帐篷有限公司、是专业设计、生产、销售、安装、一条龙服务的公司。可按顾客要求制作各式帐篷。本着【以质量求生存、以效率求发展】、企业理念。<br />\r\n　 　本公司集旗下【深圳市宝安区新安景艺彩蓬招牌设计部】。采用世界各地优质材料，生产出各种帐篷、电动遥控伸缩篷、智能电动伸缩篷、手摇篷、各式固定篷、 岗亭双开篷、工厂仓库推拉篷、产品广泛适用于工厂、小区、休闲街、花园别墅、 西餐厅、酒吧、咖啡厅、门店、宾馆酒店阳台及休闲区所、旅游景点等等.通过提供优质的产品和优质的服务、来回报广大客户对我们的支持和厚爱,本公司可上门 测量及报价，竭诚欢迎新老客户前来洽谈!24小时热线、张先生；13682589589</font></span></span><br />\r\n<hr />\r\n<br />\r\n<br />\r\n<span style="font-size:14px;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 深圳市金宏发帐篷有限公司成立于2013年，其体，已经营【深圳市宝安区新安景艺彩蓬招牌设计部】多年、本公司注册资金为50万元人民币。本公司集旗下、【深圳市宝安区新安景艺彩蓬招牌设计部】均为、正规工商注册单位，可开据国税发票、和3个点的增值税发票。<br />\r\n<br />\r\n&nbsp; &nbsp; &nbsp; 本公司的企业理念是【以质量求生存、以效率求发展】、为您打造物美价廉的产品、和舒适惬意的生活、本着品质成就未来的宗旨、与您共创美好明天。<br />\r\n备注、【工商查询】、深圳市金宏发帐篷有限公司的《篷》是竹字头的。深圳市宝安区新安景艺彩蓬设计部的《蓬》是草字头的。</span><br />\r\n<br />\r\n<hr />\r\n<br />\r\n<strong style="margin: 0px; padding: 0px; background-color: rgb(250, 250, 250); color: rgb(66, 60, 60); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 28px; ">深圳市<a href="http://www.27889815.com/" style="margin: 0px; padding: 0px; color: rgb(51, 51, 51); text-decoration: none; ">金宏发</a>帐篷有限公司</strong><br style="margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana, Geneva, sans-serif; line-height: 21px; background-color: rgb(250, 250, 250); " />\r\n<span style="margin: 0px; padding: 0px; background-color: rgb(250, 250, 250); color: rgb(66, 60, 60); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 28px; ">&nbsp;&nbsp;</span><br style="margin: 0px; padding: 0px; backgroun